import React from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Login from "./components/login.component";
import SignUp from "./components/signup.component";
import Dashboard from "./components/dashboard.component";
function App() {
  var state = { data : "Hello World" } 
  return (

    <Router basename='/react/spa/build/'>
    <div className="App">
      <div className="auth-wrapper">
        <div className="auth-inner">
          <Switch>
            <Route exact path='/' component={Login} dataFromParent={this.state.data}/>
            <Route path="/sign-in" component={Login} dataFromParent={this.state.data} />
            <Route path="/sign-up" component={SignUp} dataFromParent={this.state.data} />
            <Route path="/dashboard" component={Dashboard} dataFromParent={this.state.data} />
          </Switch>
        </div>
      </div>
    </div></Router>
  );
}

export default App;
